def my_func(input1: str) -> str:
    if len(input1) < 1 or len(input1) > 20:
        return ""
    words = input1.split()
    result = []
    for group in words:
        parts = group.split('-')
        camel_case = parts[0] + ''.join(word.capitalize() for word in parts[1:])
        result.append(camel_case)
    return ' '.join(result)
